(1901, 0, 'en', 'packages/optimize/optimize', 'elide_attributes', 'Elide attributes', '2023-03-01 00:58:41', '2023-03-01 00:59:16'),
(1902, 0, 'en', 'packages/optimize/optimize', 'elide_attributes_description', 'This filter reduces the transfer size of HTML files by removing attributes from tags when the specified value is equal to the default value for that attribute. This can save a modest number of bytes, and may make the document more compressible by canonicalizing the affected tags.', '2023-03-01 00:58:41', '2023-03-01 00:59:16'),
